import  { React, Component } from "react";

import './played-games.css'

import {
  Card,
  CardHeader,
  CardBody,
  Row,
  Col,
} from "reactstrap";


class PlayedGames extends Component{
    render() {
        return (
            <>
                <div className="content">
                <Row>
                <Col className="12">
                    <Card>
                    <CardHeader>
                    <h1 className="title">Game Played</h1>
                    </CardHeader>
                    <CardBody>
                    
                    </CardBody>
                    </Card>
                </Col>
                </Row>
                </div>
            </>
        );
    }     
}

export default PlayedGames;
